export default class Forecast extends React.Component{
      render(){
            return(
                  <div className="forecast">
                        {this.props.forecastDataArray &&   <span>{this.props.forecastDataArray.map(function(item){
                              return(
                                    <div className="weatherCard">
                                          <label>Date: </label><p>{item.dt_txt}</p>
                                          <label>Temp: </label><p>{item.main.temp}</p>
                                          <label>Weather:</label><p>{item.weather[0].description}</p>




                                    </div>
                              )

                        })}</span>}


                  </div>
            )
      }
}
